    function setPagination(minPage, maxPage, currentPage) {
        $("".pagination"").empty();
        if (maxPage == -1) return;
        var previous = $(""<li>"");
        previous.text(""Previous"");
        if (currentPage != minPage) {
            previous.click(function () {
                changePage(currentPage - 1);
            });
            previous.attr({ class: ""page-item page-link"" });
        } else {
    ");
